	def __init__(self, js, I=5, translate=True):
		self.js = js
		self.iter = I
		self.doTranslate = translate
		self.CHAR_FOR_PLUS = ''
		
	def translate_to_pure_jsf_code(self, txt):
		for key, value in self.CODE_TO_TXT.items():
			if value not in self.SKIP:
				txt = txt.replace(value, key)
		return txt
		
	def clean(self, txt):
		matches = re.finditer('\((.+?)\)\(\)', txt)
		for match in matches:
			txt = txt.replace(match.group(0), match.group(1))
		return txt
		
	def ca_decode(self):
	
		if ';' in self.js:
			jss_code = self.js.split(';')
		else:
			jss_code = [self.js]
	
		decoded = []
		for jsf_code in jss_code:
		
			if self.doTranslate:
				jsf_code = self.translate_to_pure_jsf_code(jsf_code)
			
			if re.search('[a-zA-Z]', jsf_code):
				decoded.append(jsf_code)
				pass # plain string -- skip
			else:
				wrapWithEvalUsed = False
				if jsf_code[-2:] == '()':
					wrapWithEvalUsed = True
				
				#print "wrapWithEvalUsed %s" % wrapWithEvalUsed
				
				i = 0
				while i < self.iter:
					jsf_code = JSFDecoder(jsf_code).decode()
					i += 1
				
				jsf_code = JSFDecoder(jsf_code).decode(lastpass=True)
				
				if wrapWithEvalUsed:
					jsf_code = self.clean(jsf_code)
					
				decoded.append(jsf_code)
				
		ret = ";".join(decoded)
		
		return ret

	def decode(self, lastpass=False):
		while True:
			start_js = self.js
			self.repl_words(self.CODE_TO_TXT)
			self.repl_words(self.words)
			self.repl_numbers()
			self.repl_arrays(self.words)
			self.repl_uniqs(self.uniqs)
			
			if start_js == self.js:
				break

		if lastpass:
			self.repl_words(self.CODE_TO_TXT_LASTPASS)
				
		self.js = self.js.replace('+++', self.CHAR_FOR_PLUS)
		self.js = self.js.replace('+', '')
		self.js = re.sub('\[[A-Za-z]*\]', '', self.js)
		self.js = re.sub('\[(\d+)\]', '\\1', self.js)
		
		if lastpass:
			self.js = self.js.replace(self.CHAR_FOR_PLUS, '+')

		return self.js
		
